replace INTO `creature_text` (`CreatureID`, `GroupID`, `ID`, `Text`, `Type`, `Language`, `Probability`, `Emote`, `Duration`, `Sound`, `BroadcastTextId`, `TextRange`, `comment`) VALUES
(183543, @GROUP_ID+0, @ID+0, 'I\'m getting a bit concerned... we haven\'t heard back from the patrol up at Rhonin\'s Shield.', 12, 0, 100, 0, 0, 206185, 0, 0, 'Noriko the All-Remembering to Player'),
(186151, @GROUP_ID+0, @ID+0, 'Your skulls will shatter beneath my hooves!', 14, 0, 100, 0, 0, 205471, 0, 0, 'Balakar Khan'),
(186151, @GROUP_ID+1, @ID+0, 'Slashed and skewered!', 14, 0, 100, 0, 0, 205472, 0, 0, 'Balakar Khan to Player'),
(186151, @GROUP_ID+2, @ID+0, 'If the Eagle Mother will not gift me her power, I will take it.', 14, 0, 100, 0, 0, 205501, 0, 0, 'Balakar Khan'),
(186151, @GROUP_ID+3, @ID+0, 'Thunder and lightning! The true power of Ohn\'ahra!', 14, 0, 100, 0, 0, 205473, 0, 0, 'Balakar Khan to Balakar Khan'),
(186338, @GROUP_ID+0, @ID+0, 'This is what has become of our legacy?', 14, 0, 100, 0, 0, 203860, 0, 0, 'Maruuk to Gravelord Monkh'),
(186338, @GROUP_ID+1, @ID+0, 'You shall pay for this blasphemy with your lives.', 14, 0, 100, 0, 0, 203860, 0, 0, 'Maruuk'),
(186338, @GROUP_ID+2, @ID+0, 'Flee before me!', 14, 0, 100, 0, 0, 204930, 0, 0, 'Maruuk'),
(186338, @GROUP_ID+3, @ID+0, 'Rend the earth!', 14, 0, 100, 0, 0, 204929, 0, 0, 'Maruuk'),
(186338, @GROUP_ID+4, @ID+0, 'Peace... at last...', 12, 0, 100, 0, 0, 203863, 0, 0, 'Maruuk to Player'), -- BroadcastTextID: 88150 - 174460
(186339, @GROUP_ID+0, @ID+0, 'Necromancers? On our sacred grounds?', 14, 0, 100, 0, 0, 207978, 0, 0, 'Teera to Gravelord Monkh'),
(186339, @GROUP_ID+1, @ID+0, 'This is the end, defilers.', 14, 0, 100, 0, 0, 207975, 0, 0, 'Teera'),
(186339, @GROUP_ID+2, @ID+0, 'Away from him!', 14, 0, 100, 0, 0, 207976, 0, 0, 'Teera'),
(186616, @GROUP_ID+0, @ID+0, 'Your sky darkens.', 14, 0, 100, 0, 0, 205534, 0, 0, 'Granyth'),
(186616, @GROUP_ID+1, @ID+0, 'Die! This land is mine!', 14, 0, 100, 0, 0, 205535, 0, 0, 'Granyth'),
(186616, @GROUP_ID+2, @ID+0, 'Tremble before primal power!', 14, 0, 100, 0, 0, 205540, 0, 0, 'Granyth'),
(186616, @GROUP_ID+3, @ID+0, 'Can you stand against my might?', 14, 0, 100, 0, 0, 205541, 0, 0, 'Granyth'),
(186616, @GROUP_ID+4, @ID+0, '|TInterface\\ICONS\\Spell_Nature_Earthquake.blp:20|t Granyth is about to cast |cFFFF0000|Hspell:388283|h[Eruption]|h|r!', 41, 0, 100, 0, 0, 205541, 0, 0, 'Granyth'),
(186616, @GROUP_ID+5, @ID+0, 'Incarnates... save... me...', 14, 0, 100, 0, 0, 205542, 0, 0, 'Granyth to Player'),
(189208, @GROUP_ID+0, @ID+0, 'By the Titans! This old thing sure clings to its secrets...', 12, 0, 100, 0, 0, 0, 0, 0, 'Custodian Vernagos to Player'),
(189208, @GROUP_ID+1, @ID+0, 'Let\'s start by tossing a couple embercones in there...', 12, 0, 100, 0, 0, 0, 0, 0, 'Custodian Vernagos to Player'),
(189208, @GROUP_ID+2, @ID+0, 'Aspects be praised, it worked!', 12, 0, 100, 463, 0, 0, 0, 0, 'Custodian Vernagos to Player'),
(191847, @GROUP_ID+0, @ID+0, '|TInterface\\Icons\\Ability_Warrior_BattleShout.BLP:20|tA Nokhud centaur readies a |cFFFF0000|Hspell:384365|h[Disruptive Shout]|h|r!', 42, 0, 100, 0, 0, 0, 0, 0, 'Nokhud Plainstomper to Player'),
