(192593, @GROUP_ID+0, @ID+0, 'By the Titans, now THIS is a blade!', 12, 0, 100, 906, 0, 193980, 0, 0, 'Azure Defender to Player'),
(192593, @GROUP_ID+1, @ID+0, 'By my blade shall they know me!', 12, 0, 100, 0, 0, 0, 0, 0, 'Azure Defender to Player'),
